import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
  state = {
    contacts: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      console.log(data);
    })
    .catch(console.log)
  }
  render() {
    return (
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Address</th>
            <th>City</th>
            <th>State</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <td>3</td>
            <td colSpan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
    );
  }
}

export default App;
